import React, { Fragment} from 'react';

const InputNames = props => {
    return (
        <Fragment>
            <div>
                <input
                    type="text"
                    value={props.name1}
                    onChange={(e) => props.actionSetName(1, e.target.value)}
                />
            </div>
            <div>
                <input
                    type="text"
                    value={props.name2}
                    onChange={(e) => props.actionSetName(2, e.target.value)}
                />
            </div>
        </Fragment>
    );
};

export default InputNames;
